import React from "react";
import Row from "./Row";
import TableHeader from "./TableHeader";

function Table({ tableHeader, rows, onEdit, onDelete }) {
  return (
    <table>
      <thead>
        <tr>
          <TableHeader tableHeader={tableHeader} />
        </tr>
      </thead>
      <tbody>
        {rows.map((row) => (
          <Row key={row.id} row={row} />
        ))}
      </tbody>
    </table>
  );
}

export default Table;
